window.bookSummaryJSON = "<p><b>More world building. More trade. More godly powers.</b></p> <p>When Garrett adds atmosphere to his planet and opens a new portal to an amphibious world, he never expected to find it lacking natural resources, and worse, what it lacks in useful items, it more than makes up for with dangerous enemies and natural predators.</p> <p>If he wants to have any chance of taming the place and bringing riches back to his own world, he’ll have to unify the local governments, establish trade with a neighboring world, and, of course, defeat the dungeon at the heart of the planet.</p> <p>Sure, it will be tough, but if he succeeds...well, let’s just say that the prize for success will be worth it.</p>"; 
